import Link from "next/link";

const linkStyle = {
  marginLeft: 15,
  fontWeight: "bold",
  fontSize: "large"
};

const headerStyle = {
  backgroundColor: "gray"
};

const Header = () => (
  <div style={headerStyle}>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
